import React from 'react'
import './Navbar.css';

export default function Navbar() {
  return (
    <div className='container'>
        <img className='logo' src="./images/amazon_logo.png" alt="" />
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 384 512"></svg>
    </div>
  )
}
